import React, { Component } from 'react'

class Home extends Component {


    state = {
        index : {}
    }

    componentDidMount(){
        fetch(`http://localhost:3000/api/v1/posts/?_limit=10&_page=2`)
            .then(res => res.json())
            .then(data => {
                this.setState({index : data})
            } )
    }

    render(){

        return(
            <div>
                Home
        </div>
        )
    }
}

export default Home
